import { useState } from "react";

const Example = () => {
  const [selected, setSelected] = useState("Banana");

  const OPTIONS = ["Apple", "Banana", "Cherry"]

  return (
    // <p style={{ textAlign: "center" }}>
    //   startフォルダの内容が表示されます。
    //   <br />
    //   練習用に使ってください！
    // </p>
    <>
      <select
        value={selected}
        onChange={(e) => setSelected(e.target.value)}
        ></select>
    </>
  );
};

export default Example;
